import React from "react";

function LoginPage(){
    return(
        <div>
            <h1>Fake Insurance Company</h1>

            <form>
                <h3>Log In</h3>
                <input type="text" placeholder="Email"/>
                <input type="password" placeholder="Password"/>
                <input type="submit" value="Log In"/>
            </form>
        </div>
    );
}

export default LoginPage;
